FeedPackage.ReleaseNotes:
It is very easy to use and get quick result to access web api with c# objects.

Sample code - 
var client = new ApiClient("https://api.github.com/users/octocat", MethodType.Get);
            //Headers
            //client.AddHeader("ApiKey", "test key value");

            //empty request and string response as json
            //var response = client.SendAsync().Result;

            //string request and object response
            //var response = client.SendAsync<string, ResposeMessage>("");

var client = new ApiClient("http://10.210.55.44:85/api/customers", MethodType.Get);

//use default window auth.            
client.UseDefaultCredentials = true;
var response = client.SendAsync();
Console.WriteLine(response.Result);

Now, support the network credentials, Basic and OAuth.

//default windows auth
client.UseDefaultCredentials = true;
OR
client.UseCredentials = Credentials.Default;

//Basic auth
client.UseCredentials = Credentials.Basic;
client.UserName = "testusername";          
client.Password = "pwd123";

//OAuth 
client.UseCredentials = Credentials.OAuth;
client.AccessToken = "Token1234";
